import React from 'react';

function App() {
  return (
    <>
    <div>
      <link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css"/>
      <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
      <strong>hello world</strong>
    </div>
    </>
  );
}

export default App;
